#algorithm 1, enumeration\\ enumerate every i,j combination, one list iteration for every list item
def maxsub_alg1(ar):
    max_val = SINT_MIN
    sum_val = 0
    limit = len(ar)
    for i, val in enumerate(ar):
        sum_val = val
        max_val = max(max_val, sum_val)
        for j in range(i+1, limit):
            sum_val += ar[j]
            max_val = max(max_val, sum_val)
    return max_val

#algorithm 2, better enumeration\\ Kadane's algorithm keeps track of sum through the list, one list iteration
def maxsub_alg2(ar):
    max_val = ar[0]
    sum_val = ar[0]
    for val in ar[1:]:
        sum_val = max(val, sum_val + val)
        max_val = max(max_val, sum_val)
    return max_val

#algorithm 3, divide and conquer
def maxsub_alg3(ar):
    max_val = recurse(ar, 0, len(ar))
    return max_val[0]

def recurse(ar, beg, end):
    #BASE CASES:
    # zero elements
    if end == beg:
        return (0, 0, 0)
    # one element               
    elif end == beg + 1:
        return (ar[beg], beg, end)
    #RECURRSIVE CASE:
    # two or more elements
    
    else:
        mid = (beg + end) // 2
        max1 = recurse(ar, beg, end)
        max2 = recurse(ar, mid, end)

        # work from middle down to beginning, find max. keep track of where it was found
        sum_val = 0
        left_max = SINT_MIN
        for i in range(mid-1, beg-1, -1):
            sum_val += ar[i]
            if sum_val > left_max:
                left_max = sum_val
                
        # work from middle up to end, find max. keep track of where ti was found
        sum_val = 0
        right_max = SINT_MIN
        for j in range(mid+1, end+1):
            sum_val += ar[j-1]
            if sum_val > right_max:
                right_max = sum_val
        #build results for max testing
        join_results = left_max+right_max

        #the max will either be the left array, the right array or the middle array
        return max(max1,max2,join_results)


